import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faEnvelope} from '@fortawesome/free-solid-svg-icons';
import {faGithub} from '@fortawesome/free-brands-svg-icons';
import {faGooglePlay} from '@fortawesome/free-brands-svg-icons';
import Helmet from "react-helmet";
import React from 'react';
import './Resources.css';
import Navbar from "../../components/Navbar";

const Resources = () => {
    return (
        <div className="resources">
            <Helmet bodyAttributes={{style: 'background-color : var(--color-blue)'}}/>
            <Navbar></Navbar>
            <div className="resources-body">
                <h2>Resources</h2>
                <div className="grid-container-resources">
                    <div className="grid-child-resources" id='buttonDiv'><a href='mailto:arroseplus@gmail.com' target="_blank" rel="noreferrer"><button className="iconBtn"><FontAwesomeIcon icon={faEnvelope}/></button></a></div>
                    <div className="grid-child-resources" id='buttonDiv'>><a href="https://github.com/ucfcs/GrowthPlus" target="_blank" rel="noreferrer"><button className="iconBtn"><FontAwesomeIcon icon={faGithub}/></button></a></div>
                    <div className="grid-child-resources" id='buttonDiv'>><button className="iconBtn"><FontAwesomeIcon icon={faGooglePlay}/></button></div>
                    <div className="grid-child-resources"><h3>contact us at:<br/>arroseplus@gmail.com</h3></div>
                    <div className="grid-child-resources"><h3>check out our code</h3></div>
                    <div className="grid-child-resources"><h3>download the app</h3></div>
                </div>
            </div>
        </div>   
    )
};

export default Resources;
